import React, { Component } from 'react';

class Comments extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        if (this.props.dish_comment != null) {
            const arr = this.props.dish_comment.comments.map(comment => {
                return (
                    <p>{comment}</p>
                );
            });
        }
        else {
            return (
                <div></div>
            );
        }
        return (
            { arr }
        );
    }
}

export default Comments;
